import React from 'react';
import './SideBar.css';
import SideNav,{
  Toggle,
  NavItem,
  NavIcon,
  Navtext
} from "@trendmicro/react-sidenav";

const SideBar =  () => {
  return (<SideNav
    onSelect = {selected =>{
      console.log(selected);
    }}>
      <SideNav.Toggle/>
      <SideNav.Nav defaultSelected="SoundControl">
        <NavItem>
          <NavIcon> <i className='fa fa-fw fa-home'></i></NavIcon>
          <Navtext>Sound Cotrol</Navtext>
        </NavItem>
      </SideNav.Nav>

    </SideNav>
    )

    
}

export default SideBar
